pragma solidity ^0.5.0;
contract Empresas {
    
    uint currentId;
    
    struct Empresa{
        uint idEmpresa;
        string name;
        string description;
    }

    Empresa[] empresas;

    function addEmpresa() public{
        empresas.push ( Empresa(currentId, "nombre", "descripcion"));
        currentId++;
    }

    function getEmpresa(uint _idEmpresa) public view returns (uint, string memory, string memory){
        return (empresas[_idEmpresa].idEmpresa, empresas[_idEmpresa].name, empresas[_idEmpresa].description);
    }

}
